(1, 'О компании', 'About', '<strong>Компания  «БСК» с 2010 года является одним из лидирующих поставщиков  профессиональных продуктов строительного назначения в России.</strong><p>Работая  с нашей компанией, Вы не просто приобретаете поставщика строительных  товаров, но и приобретаете надежного партнера, с которым вы будете иметь  100% гарантированный успех и высокую прибыль.</p><p><strong>Наша компания:</strong></p><ul> \r\n<li>осуществляет прямые поставки от различных производителей,</li></ul><ul> \r\n<li>высокое качество продукции,</li></ul><ul> \r\n<li>имеет собственное производство фасованной продукции,</li></ul><ul> \r\n<li>организует доставку в любую точку России,</li></ul><ul> \r\n<li>предоставляет рекламные материалы для успешного продвижения продукции, </li></ul><ul> \r\n<li>проводит обучение персонала,</li></ul><ul> \r\n<li>имеет возможность гибкого подхода к каждому клиенту. </li></ul><p><strong>Предлагаемая продукция уже зарекомендовала себя с самых лучших сторон:</strong></p><ul> \r\n<li>постоянное высокое качество; </li></ul><ul> \r\n<li>уверенный рост продаж; </li></ul><ul> \r\n<li>приверженность потребителей использующих продукцию, поставляемую нашей компанией. </li></ul><p>Многие  компании в Санкт-Петербурге и по всей России уже стали нашими  партнерами. Мы гарантируем индивидуальный профессиональный подход к  каждой задаче, которая стоит перед Вашей компанией.<br> Кроме  предложенной продукции на нашем складе Вы всегда найдете широкий  ассортимент строительных материалов отечественного и импортного  производства по самым конкурентным ценам.</p><p>Мы будем рады стать Вашим постоянным поставщиком товаров строительного назначения.</p><h3><strong>Реквизиты:</strong></h3><p>ООО «СитиСтройРесурс»</p><p>ИНН 7814556921 КПП781401001</p><p>Юр.адрес: 197183, г.Санкт-петербург, ул. Сабировская, дом 41</p><p>Факт.адрес:197183, г.Санкт-Петербург, ул. Сабировская, дом 41</p><p>Расч./сч. № 40702810001090088761</p><p>в ОАО «Энергомашбанк»</p><p>к/с 30101810700000000754</p><p>БИК 044030754</p><p>ОГРН 1127847665945</p><p>ОКПО 46882985</p>', 'О компании, БСК', '2014-06-15 14:50:42', '2014-06-15 15:48:56', 'about', 'About'),
(3, 'Доставка', 'О доставке', '<p>Бесплатная доставка при сумме заявки от 10 тыс.руб. до вашего склада в течение трех рабочих дней с момента подтверждения выставленного счета.</p>', 'Доставка, БСК', '2014-06-15 15:45:28', '2014-06-15 15:45:28', 'delivery', 'delivery'),
(4, 'Оплата', 'Описание способов оплаты', 'Описание способов оплаты', 'Оплата, БСК', '2014-06-15 15:53:26', '2014-06-15 15:53:26', 'payment', 'payment'),
(5, 'Прайс-лист', 'Прайс-лист', 'Прайс-лист', 'Прайс-лист, БСК', '2014-06-15 15:54:41', '2014-06-15 15:54:41', 'price-list', 'price-list'),
(6, 'Вакансии', 'Описание вакансий', '<h3>Торговый представитель</h3><h4>Требования к кандидату:</h4><p>- Опыт работы в продажах торговым представителем (желательно рынок DIY);<br> - Права категории В, наличие собственного ам.</p><h4>Обязанности и условия:</h4><p>- Создание и развитие клиентской базы.<br> - Активный поиск, работа в "полях" с конечными потребителями электрооборудования (автомастерские, строительные бригады, рынки)<br> - Заключение контрактов с заказчиками, организация и контроль отгрузок товара. <br> - Выполнение планов продаж на закрепленной территории.<br> - Работа с дебиторской задолженностью.<br> - Ведение сделки от этапа переговоров до отслеживания отгрузки</p><h3>Контактные данные:</h3><p><a href="mailto:sale@bsc-ltd.ru">sale@bsc-ltd.ru</a></p>', 'Вакансии, БСК', '2014-06-15 16:00:45', '2014-06-15 16:00:45', 'vacancy', 'vacancy'),
(7, 'Гарантия и севрис', 'Гарантия и севрис', 'Гарантия и севрис', 'Гарантия и севрис, БСК', '2014-06-15 16:02:06', '2014-06-15 16:02:06', 'service', 'service'),
(8, 'Возврат товара', 'Возврат товара', 'Возврат товара', 'Возврат товара, БСК', '2014-06-15 16:02:43', '2014-06-15 16:02:43', 'return', 'return'),
(9, 'Контакты', 'Контакты', '<div style="width: 100%; height: 400px;">\r\n            <script type="text/javascript" charset="utf-8" src="//api-maps.yandex.ru/services/constructor/1.0/js/?sid=FOyHse78UYx0SPO9ENPLGzBpOiOlFztf&width=100%&height=450"></script>\r\n        </div>', 'Контакты', '2014-06-15 16:03:13', '2014-06-15 16:12:20', 'contacts', 'contacts');
